import React from 'react';

const Dashboard = () => {
  return (
    <div style={{ textAlign: 'center', marginTop: '100px' }}>
      <h2>Welcome to the Game!</h2>
      <button>Leader Board</button>
      <br />
      <button>Easy</button>
      <button>Medium</button>
      <button>Hard</button>
      <br />
      <button>Quit</button>
    </div>
  );
};

export default Dashboard;
